import React, { useState } from "react";
import "./css/nav.css";
import { useNavigate } from "react-router-dom";
function Nav() {
  const navigate =useNavigate();
  const [isOpen, setIsOpen] = useState(false);
  const p = () => {
    setIsOpen(!isOpen);
  };
  const h = ()=>{
    navigate("/home");
  }
  const u = ()=>{
    navigate("/um");
  }
  return (
    <div className="nav">
      <h1>GAMING HUB</h1>
      <div className="hur">
        <button onClick={h}>HOME</button>
        <button className="ur" onClick={u}>UPCOMMING MATCHES</button>
        <button className="ur">RESULT</button>
      </div>
      <div className="p">
        <button onClick={p}>PROFILE</button>
      </div>
      {isOpen && (
          <div className="dw">
            <button>DEPOSIT</button>
            <button>WITHDRAW</button>
          </div>
        )}
    </div>
  );
}
export default Nav;
